import React from 'react';
import Carousel from '../../../components/main/section-projects/Carousel';

function Projects() {
  return (
    <section className="projects" id="projects">
      <h2 className="projects-title">Projets</h2>
      <Carousel />
    </section>
  );
}

export default Projects;
